window.bookSummaryJSON = "<p><b>Promised since birth. Bound to a pack I never wanted.</b></p> <p><b>Ruby</b></p> <p>My family has always told me I was destined for the Crawford Pack, my future set in stone from the day I was born.</p> <p>But I've never cared for the life of birthing babies for a pack. Not when I've got Jasper—rugged, packless, and watching me from across the ranch with a hunger in his eyes.</p> <p>The night he confesses his feelings, I run away with him. It's a dream come true until my heat hits—but one alpha isn't enough for an omega, and he leaves me. Desperate, I flee into the night, searching for relief.</p> <p>And that's when I find them.</p> <p>The pack I was promised to—ready and waiting to claim what's always been theirs. But now, there's a new alpha in the mix, an outsider named Marrok. And he believes I'm meant for him.</p> <p>Jasper. The Crawford Pack. Marrok. They all want me. But I can only belong to one.</p> <p>Promised to the Alphas <i>is a standalone in the Dawn of the Alphas series. If you love drama, angst, and fiercely protective alphas, this one's for you. Features scorching heat, possessive growly alphas, pregnancy and birth, no MM, and first-person multiple PoVs.</i></p>"; 
